import Map from "../Images/moscumapa.jpeg";

const Bookings = () => {
  return (
    <div className="container bg-black">
      <div className="row">
        <div className="columns-20">
          <h1 className="text-white text-4xl ms-28">DO YOUR BOOKINGS HERE!</h1>
          <h3 className="grid ms-96 text-4xl text-white">
            LISTA DE MESAS DISPONIBLES
          </h3>
          <div className="w-6/12 rotate-270">
            <img src={Map} alt="mapa" />
          </div>
        </div>
      </div>
      <div className="container mx-auto"></div>
    </div>
  );
};

export default Bookings;
